Application.ScrollMagic.Scenes.Partners=function(){const TIMELINE=(new TimelineMax).fromTo("[data-target='partnersTitle']",2,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0});for(const[index,element]of Object.entries(document.querySelectorAll('[data-target="partnersImage"]')))TIMELINE.fromTo(element,2,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0},index/2);return Application.Layout.set("Partners",new ScrollMagic.Scene({triggerElement:"#partners",triggerHook:.85,duration:"70%"}).setTween(TIMELINE).addTo(Application.ScrollMagic.Controllers.Main)),!0};